-- ----------------------------
-- Table structure for account
-- ----------------------------
DROP TABLE IF EXISTS `account`;
CREATE TABLE `account` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(255) DEFAULT NULL COMMENT '名称',
  `adminId` int(11) NOT NULL DEFAULT '0' COMMENT '管理员ID',
  `members` tinyint(4) NOT NULL DEFAULT '0' COMMENT '成员数量',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '帐号状态(1-正常,2-手动修改)',
  `phone` varchar(20) DEFAULT NULL COMMENT '电话号码',
  `imei` varchar(255) DEFAULT NULL COMMENT '手机唯一标识',
  `password` varchar(255) DEFAULT NULL COMMENT '密码',
  `qrcode` varchar(255) DEFAULT NULL COMMENT '二维码',
  `wx` tinyint(4) DEFAULT '0' COMMENT '通过微信注册的',
  `jcAccount` varchar(255) DEFAULT NULL COMMENT '捷成登录',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型（0-app,1-微信，2-红包，3-班豆）',
  PRIMARY KEY (`id`),
  KEY `index_phone` (`phone`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=723 DEFAULT CHARSET=utf8 COMMENT='账号';

