  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '产品序号(只是作为商品序号,真正的商品通过code获取)',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '产品类型(1-vip,2-栗子,3-课程)',
  `name` varchar(255) DEFAULT NULL COMMENT '产品名称',
  `price` float NOT NULL DEFAULT '0' COMMENT '产品价格（Android）',
  `iosPrice` float NOT NULL DEFAULT '0' COMMENT '产品价格（ios）',
  `count` int(11) NOT NULL DEFAULT '0' COMMENT '产品数量',
  `payCode` varchar(255) DEFAULT NULL COMMENT 'payCode',
  `status` int(11) NOT NULL DEFAULT '0' COMMENT '状态(0-已下架,1-正常)',
  `description` varchar(255) DEFAULT NULL COMMENT '产品描述',
  `code` int(11) NOT NULL DEFAULT '0' COMMENT '产品标识码(用于确定具体属于哪种商品,目前只有VIP才有)',
  `originalPrice` float NOT NULL DEFAULT '0' COMMENT '原价',
  `iosOriginalPrice` varchar(255) NOT NULL DEFAULT '0' COMMENT 'ios原价',
  `payCodeIphone` varchar(255) DEFAULT NULL COMMENT 'iphone版本支付代码',
  `limitCount` smallint(8) NOT NULL DEFAULT '0' COMMENT 'limitCount',
  `limitStartTime` datetime DEFAULT NULL COMMENT 'limitCount',
  `limitEndTime` datetime DEFAULT NULL COMMENT 'limitCount',
  `showCode` int(11) unsigned NOT NULL COMMENT '显示编号(每一个产品必须要有显示编号,如果显示编号相同的产品,只展示最前面的产品)',
  `specialPrice` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否特价',
