-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(100) DEFAULT NULL COMMENT '昵称',
  `gender` tinyint(4) NOT NULL DEFAULT '1' COMMENT '性别',
  `head` varchar(255) DEFAULT NULL,
  `birthday` date DEFAULT NULL COMMENT '生日',
  `accountId` int(11) NOT NULL DEFAULT '0' COMMENT '帐号ID',
  `admin` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否为管理员(0-否，1-是)',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '成员类型(1-注册成员，2-游客)',
  `imei` varchar(100) DEFAULT NULL COMMENT '唯一设备号(注册时使用的设备)',
  `clientId` varchar(100) DEFAULT NULL COMMENT '推送id(android)',
  `deviceToken` varchar(100) DEFAULT NULL COMMENT '推送ID(ios)',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `status` tinyint(4) NOT NULL DEFAULT '0' COMMENT '状态(0-正常)',
  `novice` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否新手(0-否，1-是)',
  `phone` varchar(11) DEFAULT NULL COMMENT '手机号',
  `password` varchar(100) DEFAULT NULL,
  `gold` int(11) NOT NULL DEFAULT '0' COMMENT '用户金币',
  `firstPay` tinyint(4) NOT NULL DEFAULT '1' COMMENT '首充状态(0-否,1-是)',
  `openId` varchar(255) DEFAULT NULL COMMENT '微信openId ',
  `continueLogin` int(11) NOT NULL DEFAULT '0' COMMENT '连续登陆天数',
  `cumulativeLogin` int(11) NOT NULL DEFAULT '1' COMMENT '累计登陆天数',
  `evalUserId` int(11) NOT NULL DEFAULT '0' COMMENT '测评用户ID',
  `channel` int(8) DEFAULT '0' COMMENT '渠道',
  `trainingType` tinyint(4) NOT NULL DEFAULT '0' COMMENT '用户在玩游戏时采用的游戏升级策略(0-失败1次降,通关升,1-3次失败才降，2-永不升降)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `account_name` (`accountId`,`name`) USING BTREE,
  KEY `phone_password` (`phone`,`password`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1847 DEFAULT CHARSET=utf8 COMMENT='用户';

